import React, { Fragment } from "react";
import {
  Container,
  Card,
  Form,
  FormLabel,
  Row,
  Col,
  Button,
  FormCheck,
  FormGroup,
  FormSelect,
  FormControl,
} from "react-bootstrap";
import Contacto from "../componentes/principal/Contacto";
import Eventos from "../componentes/principal/Eventos";

const Principal = () => {
  return (
    <Fragment>
      <Eventos></Eventos>
      <Contacto></Contacto>
    </Fragment>
  );
};

export default Principal;
